Gnathosoma (
Figs. 7–9
). With one pair of barbed galealae (
cs
), one pair of spine-like setae (
as
), and one pair of barbed subcapitular (
bs
); 
bs
longer than 
as
, 
bs
subequal to 
cs
(
Table 1
). Palpfemur with one barbed dorsal seta; palpgenu with two barbed dorsal setae and two barbed ventral setae. Palptibia with one barbed ventral seta, one nude ventral seta, and one nude dorsal seta; palpal tibial claws simple with tooth-like protrusion located ventrally at 
c
. half of the odontus length. Palptarsus with six setae, of which three nude, one barbed, one solenidion, and one eupathidium. fPp = B-B-BBBB-BNN-BNNNωζ. Palpal supracoxal setae (
ep
) peg-like.

Legs. With six free segments (femora subdivided). IP= 2274̅2402 (
Table 2
). Leg IV slightly longer than Leg I; leg III the shortest, leg III is almost the same length as leg II. Supracoxalae of legs I (
eI
) and II (
eII
) tiny and peg-like; the ventral side of tarsi covered with brush-like setae, tarsi I had the largest number of brush-like setae. All leg tarsi terminated with two sickle-like claws, covered with fimbriae. Normal setae on legs barbed. Leg special setae formula: Leg I: Ge—2σ, 1κ; Ti—4φ, 1κ; Ta—~11ω, 4ζ. Leg II: Ge—1σ, 1κ; Ti—2φ, 1κ; Ta—2ω, 2ζ. Leg III: Ge—1σ; Ti—1φ; Ta—1ω, 2ζ. Leg IV: Ge—2σ; Ti—1φ; Ta—2ζ.

Dorsum. Scutum longitudinal, length distinct longer than width, with middle part of the lateral margin indistinct (Figs. 30 & 41). Anterior margin slightly convex, posterior margin deep V-shaped narrower than in deutonymphs. Sclerotized part of crista metopica inserted between anterior and posterior sensillary areas linear in scutum. AL placed slightly anterior to bases of ASens; AL slightly longer than ASens, but shorter than PSens. ASens and PSens both with fine setules all their lengths. One eye and one urnula on each side of scutum (
Fig. 29
).

In females, genital opening (
Fig. 31
) at level of coxae IV; epivalves and centrovalves covered with needle-like nude setae; anterior part of centrovalves more sclerotized than epivalves. Anus oval, surrounded by sclerites with five pairs of nude setae.

Legs. With six free segments (femora subdivided). IP= 
3129–3798 in
females (
Table 3
); IP= 
3669–3988 in
males (
Table 4
). Leg I slightly longer than leg IV; leg II the shortest, leg III slightly longer than leg II. Supracoxalae of legs I (
eI
) and II (
eII
) tiny and peg-like; the ventral side of tarsi covered with brush-like setae, tarsi I with the largest number of brush-like setae. All leg tarsi terminated with two sickle-like claws, covered with fimbriae. Normal setae on legs barbed. The formula of special setae on a leg of females and males are different, particularly, the males with a large number of solenidia on TFe I and the females without solenidion on TFe I. In males with ~31 solenidia on Ge I and with ~34 solenidia on Ti I, in females with four solenidia on Ge I and with six solenidia on Ti I. Leg special setae formula by following: In females: Leg I: Ge—4σ, 1κ; Ti—6φ, 1κ; Ta—~18ω, 4ζ. Leg II: Ge—2σ, 1κ; Ti—3φ; Ta—4ω, 4ζ. Leg III: Ge —2σ; Ti—2φ; Ta—1ω, 2ζ. Leg IV: Ge—3σ; Ti—3φ; Ta—2ω, 2ζ. In males: Leg I: TFe—~23θ; Ge—~31σ, 1κ; Ti—~34φ, 1κ; Ta—~32ω, 2ζ. Leg II: Ge—2σ, 1κ; Ti—4φ; Ta—4ω, 4ζ. Leg III: Ge—2σ; Ti—2φ; Ta—1ω, 2ζ. Leg IV: Ge—3σ; Ti—3φ; Ta—2ω, 2ζ.

